import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Button } from '@mui/material';
import logo from '../images/logo.svg'; // Adjust the path to where your logo.svg is located
import '../styles/Navbar.css'; // Import the CSS file
import { styled } from '@mui/material/styles';

const CustomAppBar = styled(AppBar)({
    backgroundColor: 'white',
    boxShadow: 'none', // Remove box-shadow if needed
  });

const Navbar = () => {
  return (
    <CustomAppBar >
      <Toolbar>
        <img
          src={logo}
          alt="Logo"
          className="navbar"
        />
        <Button
          color="inherit"
          component={Link}
          to="/"
          style={{ color: '#333' }} // Override button color
        >
          Home
        </Button>
        <Button
          color="inherit"
          component={Link}
          to="/services"
          style={{ color: '#333' }} // Override button color
        >
          Services
        </Button>
        <Button
          color="inherit"
          component={Link}
          to="/contact"
          style={{ color: '#333' }} // Override button color
        >
          Contact Us
        </Button>
        <Button
          color="inherit"
          component={Link}
          to="/location"
          style={{ color: '#333' }} // Override button color
        >
          Location
        </Button>
      </Toolbar>
    </CustomAppBar>
  );
};

export default Navbar;
